import React from 'react'
import styled from 'styled-components';
import './WhoComponent.css';
import ParallaxImage from '../WhoComponent/ParallexImage'

const Section=styled.div`
height:100vh;
background-color:red;
scroll-snap-align:center;
overflow: hidden;
`;




const WhoComponent = () => {

  const parallaxData = [
    {
      imageUrl: '../../../Assets//image1.jpg',
      parallaxSpeed: 1,
    },
    {
      imageUrl: '../../../Assets//image2.jpg',
      parallaxSpeed: 2,
    },
    {
      imageUrl: '../../../Assets//image3.jpg',
      parallaxSpeed: 3,
    },
    {
      imageUrl: '../../../Assets//image4.jpg',
      parallaxSpeed: 4,
    },
  ];
  return (
    <Section>
<div class="parallax-container">
    <div class="parallax-image" style="background-image: url('path/to/image1.jpg');"></div>
    <div class="parallax-image" style="background-image: url('path/to/image2.jpg');"></div>
    <div class="parallax-image" style="background-image: url('path/to/image3.jpg');"></div>
    <div class="parallax-image" style="background-image: url('path/to/image4.jpg');"></div>
  </div>
    </Section>
  )
}

export default WhoComponent
